script: |
  super -f tsv -I q9680.sql | sort > q9680.out

vector: true

inputs:
  - name: q9680.sql
    data: |
      SELECT NULLIF ( + 12, + cor0.col1 * + cor0.col1 ) AS col1 FROM tab1 AS cor0 GROUP BY cor0.col1, cor0.col2;
  - name: tab1

outputs:
  - name: q9680.out
    data: |
      12
      12
      12
